INSERT INTO `dy_news` VALUES (1, '关于保证金', '官方团队', '新手指南', '1', '为了给予合作需求方一个保障，需要交纳一部分等级制保证金，保证金将在固定期限内退回平台账户。用户注册日起90天内保证金自动退回账户，可自行提现。', 1, 1, 1, '2019-08-18 02:51:22', '2019-08-18 02:51:22');
INSERT INTO `dy_news` VALUES (2, '如何提现', '官方团队', '新手指南', '1', '请打开APP——我的——提现——填写绑定到账银行卡或支付宝账号。', 1, 1, 1, '2019-08-18 02:52:31', '2019-08-18 02:56:06');
INSERT INTO `dy_news` VALUES (3, '提现规则', '官方团队', '新手指南', '1', '<p>\r\n	 1.提现10:00——22：00到账时间为2小时内自动到账。\r\n</p>\r\n<p>\r\n	  2.提现金额10元起，当日不限次数。\r\n</p>\r\n<p>\r\n	 3.提现收取1元手续费，到账自动扣除。\r\n</p>', 1, 1, 1, '2019-08-18 02:53:32', '2019-08-18 02:55:55');
INSERT INTO `dy_news` VALUES (4, '赞多多如何赚钱', '官方团队', '公告', '1', '<p>\r\n	 1.赞多多合作需求方每日发送视频链接点赞需求，增加创作内容的权重，领取任务后即可获得需求方奖励金，任务完成后自动到账。\r\n</p>\r\n<br>\r\n<p>\r\n	 2.平台前期为打开市场推广，发放相应推广奖励，推广方法为打开APP——邀请好友将推广二维码发送好友注册即可获得推广奖励。\r\n</p>', 1, 1, 1, '2019-08-18 02:54:39', '2019-08-18 03:37:21');
